import React from 'react';
import './CryptoList.css';

const CryptoList = () => {

    return(
        <div className="CryptoList">
            <ul className="CryptoListUl">
                <li>EUR/BTC</li>
                <li>PLN/BTC</li>
                <li>USD/BTC</li> 
            </ul>
        </div>
    )
}

export default CryptoList;
